                                   `star` int(11) NOT NULL DEFAULT '5' COMMENT '評論星級',
                                   `more` json DEFAULT NULL,
                                   `status` int(11) NOT NULL DEFAULT '2' COMMENT '狀態：1 審覈通過，2 待審覈，3 審覈不通過',
